import java.util.Hashtable;

public class Main {
    public static void main(String[] args) {
        Hashtable<Integer, String> table = new Hashtable<>();
        table.put(0, "Initial");
        table.put(1, "Value1");
        table.put(2, "Value2");
        table.put(3, "Value3");

        // Complex logic to determine what gets written
        int x = (int) (Math.random() * 10);
        int y = x * 3 + 2;
        // Adding misleading modifications to the table
        for (int i = 4; i < 10; i++) {
            table.put(i, "Misleading" + i);
        }

        /* write */
        if (y % 2 == 0) {
            table.put(1, "Correct Write");  // This is the write that affects the read
        } else {
            table.put(1, "Wrong Write");
        }

        table.put(11, "Other Write");

        // More operations possibly confusing static analysis
        table.remove(0);
        table.put(x + 10, "Confusion" + y);

        /* read */ String ret = table.get(1);  // This retrieves the value affected by the correct write
        System.out.println("Retrieved: " + ret);
    }
}
